service.description:
&lt;p&gt;
	The Australian Cooperative Digitisation Project website supports a pilot digitisation project coordinated by the National Library of Australia.&nbsp; The Australian Cooperative Digitisation Project undertook the development of a digital library of Australian journals, newspapers and novels published in the period 1840-1845.&nbsp; The University of Sydney Australian Cooperative Digitisation Project website hosts the four novels included within The Australian Cooperative Digitisation Project.&lt;/p&gt;
&lt;p&gt;
	The Australian Cooperative Digitisation Project website is part of the Australian Digital Collections website, which is hosted and managed by the University of Sydney Library.&lt;/p&gt;
